using System;
using System.Collections.Generic;
using System.Linq;
using Newtonsoft.Json;
using Newtonsoft.Json.Serialization;

namespace Binateq.GpsTrackFilter.Demo
{
    class Program
    {
        static void Main(string[] args)
        {
            switch (args.FirstOrDefault())
            {
                case "raw":
                    PrintPoints(RawGpsTrack);
                    break;

                case "filtered":
                    var filter = new GpsTrackFilter();
                    var gpsTrack = filter.Filter(RawGpsTrack);
                    PrintPoints(gpsTrack);
                    break;

                default:
                    Console.WriteLine("Filters demo GPS track with bad data.");
                    Console.WriteLine("  demo raw | filtered");
                    break;
            }

        }

        static void PrintPoints(params IEnumerable<Tuple<double, double, DateTimeOffset>>[] points)
        {
            var multiLineString = new
            {
                type = "FeatureCollection",
                features = new[]
                {
                    new
                    {
                        type = "Feature",
                        properties = new { },
                        geometry = new
                        {
                            type = "MultiLineString",
                            coordinates = points.Select(x => x.Select(y => new []{y.Item2, y.Item1})),
                        }
                    }
                }
            };

            var settings = new JsonSerializerSettings
            {
                ContractResolver = new CamelCasePropertyNamesContractResolver(),
                Formatting = Formatting.Indented,
                NullValueHandling = NullValueHandling.Ignore,
            };

            var geoJson = JsonConvert.SerializeObject(multiLineString, settings);

            Console.Write(geoJson);
        }

